package com.duapps.affair.demo.bean;import com.baomidou.mybatisplus.annotation.*;import lombok.AllArgsConstructor;import lombok.Data;import lombok.NoArgsConstructor;import java.io.Serializable;import java.util.Date;/** * @Author he.zhou * @Date 2020-12-01 */@Data@AllArgsConstructor@NoArgsConstructor@TableName("hw_order")public class HwOrder implements Serializable {    @TableId(type = IdType.AUTO)    private Long id;    private String orderId;    private String openId;    private String payOrderId;    private String productId;    private Long applicationId;    /**     * 消耗状态，仅一次性商品存在     * 0：未消耗     * 1：已消耗     */    private Integer consumptionState;    private Integer confirmed;    private String country;    private String developerChallenge;    /**     * 用户的unionId     */    private String developerPayload;    private Integer kind;    private String packageName;    private String payType;    private Long price;    private String productName;    private Integer purchaseState;    private Long purchaseTime;    private String purchaseToken;    @TableField(fill = FieldFill.INSERT)    private Date createTime;    @TableField(fill = FieldFill.INSERT_UPDATE)    private Date updateTime;}